title: Mutual recursion in a chain of inheritance
description: >
  The defect manifests in the form of call chain cycles.
  The following cycles are present here:
  o18904.m7 -> o18903.m34 -> o18904.m7
  o18904.m19 -> o18903.m34 -> o18904.m7 -> o18903.m34
  o18903.m34 -> o18904.m7 -> o18903.m34
  o18903.m24 -> o18904.m7 -> o18903.m34 -> o18904.m7

features:
  - inheritance
  - overriding
  - method
  - polymorphism

